import React from 'react'

const TableRow = ({row}) => (
  <tr>
    {console.log(row)}
  </tr>
)

const Table = ({lista}) => (
  <table>
    {lista.forEach((linha)=>(
      <TableRow row={linha}/>
    ))}
  </table>
)

export default Table
